This awesome Danish-made film is one of my favorite animated movies. A boy&amp;#039;s little sister gets turned into a starfish and thrown into the ocean, so he and his cousin take the same &quot;fish potion&quot; to go after her. Unfortunately the antidote was taken by a pilot fish (Alan Rickman) with dreams of world domination, and it gives him human intelligence. Can the boys save the little girl AND stop the pilot fish from amassing an army?

IMDb: http://www.imdb.com/title/tt0168856/
Running Time: 77 minutes

The quality isn&amp;#039;t super-fantastic, but it&amp;#039;s tricky balancing bitrates with a reasonably-sized file. I suggest if you want super-high quality you track down the DVD if you can. If you are in the States you won&amp;#039;t be able to find &quot;Help! I&amp;#039;m a Fish&quot; but you WILL find something called &quot;A Fish Tale&quot; - you may have seen it in the video store and avoided it because of the horrid cover. It is in fact the same film (they only changed the title screen).

